import React from "react";
import "./SimilarProducts.scss";

class SimilarProducts extends React.Component {
  render() {
    return (
      <section className="grid__similar-products">
        <h2>Similar Products</h2>
      </section>
    );
  }
}
export default SimilarProducts;
